from typing import List
class Solution:
    def twoSum(self, numbers: List[int], target: int) -> List[int]:
        l, r = 0, len(numbers) - 1

        while l < r:
            curSum = numbers[l] + numbers[r]

            if curSum > target:
                r -= 1
            elif curSum < target:
                l += 1
            else:
                return [l + 1, r + 1]


obj = Solution()
for args in params:
    ret = obj.twoSum(args['numbers'], args['target'])
    print("\u2705 Test Passed.") if ret == args['ret'] else print(f"\u274c Test Failed. Input: {args['numbers']}, {args['target']}, expected: {args['ret']} but got {ret}")

