    for (let [val, random_index] of input_list) {
        let node = new Node(val)
        nodes.push(node)
    }
    for (let [i, [val, random_index]] of input_list.entries()) {
        if (i < input_list.length - 1) {
            nodes[i].next = nodes[i+1]
        }
        if (random_index !== null) {
            nodes[i].random = nodes[random_index]
        }
    }
    return nodes[0]
}

function convert_from_linked_list(head) {
    let result = []
    let head_copy = head
    while (head) {
        let index = -1
        if (head.random) {
            let temp = head_copy
            let i = 0
            while (temp) {
                if (temp === head.random) {
                    index = i
                }
                temp = temp.next
                i += 1
            }
        }
        result.push([head.val, index])
        head = head.next
    }

    function convert(lst) {
        for (let i = 0; i < lst.length; i++) {
            for (let j = 0; j < lst[i].length; j++) {
                if (lst[i][j] === -1) {
                    lst[i][j] = null
                }
            }
        }
        return lst
    }
    return convert(result)
}

